import React from 'react';
import Personlist from './Personlist'
import {people} from './People'


const App =()=>{
    return (
        <div className='mw tc center'>
            <div>
                <h1 className='georgia f2'>Passionate Moods</h1>
            </div>
            <Personlist people={people}/>
        </div>
    )
}



export default App;
